import MainVideoInfo from './MainVideoInfo';
import MainVideoComments from './main-video-comments/MainVideoComments';

class MainVideo extends Component {

    state = {

    }

    render () {
        return (
            <>
                <VideoPlayer
                    id = {mainVid.id}
                    title = {mainVid.title}
                    description = {mainVid.description}
                    channel = {mainVid.channel}
                    image = {mainVid.image}
                    views = {mainVid.views}
                    likes = {mainVid.likes}
                    video = {mainVid.video}
                    comments = {mainVid.comments}
                />
                <MainVideoInfo/>
                <MainVideoComments/>
            </>
        );
    }
}
export default MainVideo;
